import './App.css';

function App() {

  /*
   * Example of imperative style of code (JS)
   */
  const paragraph = document.createElement("p");
  paragraph.textContent("Hello, I'm an example of Imperative style of code (JS).!");
  document.getElementById("root").append(paragraph);

  return (
    <div className="App">
      <h3>Hello World</h3>
    </div>
  );
}

export default App;
